script: |
  super -f text -I q5549.spq | sort > q5549.out

inputs:
  - name: q5549.spq
    data: |
      SELECT DISTINCT - col0 - - col0 / + col0 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT NULL NOT IN ( + 26 * - + col0, - col0 - col1 / - - 32 );
  - name: tab1

outputs:
  - name: q5549.out
    data: |
